import React from 'react';
import './styles.css'

export function GetMockData({index, name, products}) {
    return (
        <div>
            <h3>{ index }</h3>
            <h2>{ name }</h2>
            <ul>{products.map((item) => <li>{item}</li>)}</ul>
        </div>


    );
}

export default GetMockData;
